import React from "react";

const Table = ({ data }) => {
  return (
    <table>
      <tbody>
        <tr>
          <th>First_Name</th>
          <th>Last_Name</th>
          <th>Email</th>
        </tr>
        <tr>
          <td>yash</td>
          <td>thaoker</td>
          <td>yash@gmail.com</td>
        </tr>
      </tbody>
    </table>
  );
};

export default Table;
